def FindWords(board: List[List[str]], words: List[List[str]]) -> Set[Tuple[str, ...]]:
    if len(board) > 0 and len(board[0]) == 0:
        raise ValueError("If board has rows, it must have columns")

    ROWS = len(board)
    COLS = len(board[0]) if ROWS > 0 else 0

    # Convert words to tuple for hashability and quick lookup
    word_set = set(tuple(w) for w in words)
    prefix_set = set()
    for w in word_set:
        for i in range(1, len(w)+1):
            prefix_set.add(w[:i])

    found = set()

    def dfs(r, c, path, visited):
        if (r < 0 or r >= ROWS or c < 0 or c >= COLS or (r, c) in visited):
            return
        path = path + (board[r][c],)
        if path not in prefix_set:
            return
        if path in word_set:
            found.add(path)
        visited.add((r, c))
        for dr, dc in [(-1,0),(1,0),(0,-1),(0,1)]:
            dfs(r+dr, c+dc, path, visited)
        visited.remove((r, c))

    for r in range(ROWS):
        for c in range(COLS):
            dfs(r, c, tuple(), set())

    return found
